import '../assets/CSS/footer.css'
import icon from '../assets/images/vector_284280.png'
export default function Footer(){
    return(
        <div className='footer'>
            <div>
            <img src={icon} className='footericon'/>
            <h1>Hello world</h1>
            </div>

        </div>
    )
}
